import React, { useState } from "react";
import HomeLayout from "../../layout/HomeLayout/HomeLayout";
import Splash from "../../components/splash/splash";
import { Navigate, useNavigate } from "react-router-dom";
const AskAvet = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  setTimeout(() => {
    setLoading(false);
  }, 2000);
  return (
    <HomeLayout>
      {loading ? (
        <Splash />
      ) : (
        <section
          style={{
            padding: "60px 24px 100px 24px",
            backgroundColor: "#f3f4f6",
            height: "auto",
            width: "100%",
          }}
        >
          <div
            style={{
              backgroundColor: "rgb(206, 194, 238)",
              marginTop: "28px",
              borderRadius: "8px",
              padding: "40px 0 0 0 ",
            }}
          >
            <p
              style={{
                marginBottom: "0",
                fontSize: "28px",
                letterSpacing: "-0.27px",
                lineHeight: "30px",
                fontFamily: "Bungee",
                fontWeight: "400",
                color: "#fff",
                textAlign: "center",
              }}
            >
              no concern <br /> is too small, <br /> ask an expert!
            </p>
            <p
              style={{
                marginBottom: "0",
                fontFamily: "Space Grotesk",
                lineHeight: "18px",
                color: "#fff",
                fontWeight: "600",
                fontSize: "14px",
                textAlign: "center",
                marginTop: "8px",
              }}
            >
              24/7 support from our trusted experts
            </p>
            <p
              style={{
                marginBottom: "0",
                fontFamily: "Space Grotesk",
                lineHeight: "18px",
                color: "#fff",
                fontWeight: "600",
                fontSize: "14px",
                textAlign: "center",
                marginTop: "8px",
              }}
            >
              100% money back guarantee!
            </p>
            <p
              style={{
                marginBottom: "0",
                textAlign: "center",
                fontWeight: "600",
                fontFamily: "Space GrOtesk",
                color: "#fff",
                fontSize: "14px",
                marginTop: "24px",
              }}
            >
              COMMING SOON!
            </p>
            {/* <img style={{ width: "100%", marginTop: "24px" }} src={Ask} /> */}
          </div>
        </section>
      )}
    </HomeLayout>
  );
};

export default AskAvet;
